import 'bootstrap/dist/css/bootstrap.min.css';
//import './css/Presentacion.css';
import { Button } from 'bootstrap';
import './css/Funcionalidades.css'
import imagen13 from '../../Assets/imagen12.jpg';

function Funcionalidades(){
    return(
        <div class="fondo-funcionalidades">
            <div class="container py-5">
                <div class="row mx-5 align-items-center"> 
                    <div class="col-7 ml-3 text-left">
                        <p class="section-titles  funcionalidades-title">¿Por qué elegir <span class="highlight-text">Innoventa</span>?</p>
                        <p class="subheading ">Porque inoventa gestiona las mejores herramientas, usuarios, roles, ventas y pagos.</p>
                        <button class="btn btn-warning boton-comenzar funcionalidades-button"><stong>Contacto </stong></button>
                    </div>
                  
                    <div class="col-5 image-grid-funcionalidades">
                        <img src={imagen13} class="grid-image-funcionalidades imagen13"/>  
                    </div>
                    
                </div>
            </div>
        </div>
    )
}

export default Funcionalidades;
